    float alpha2;
    float alpha3;
    float beta1;
    float beta2;
    float beta3;

    // augmented error
    float a_err_kminus1;

    // recurrence equation variables for y_{m} ==> Y(z)/R(z) = W_{m}(z)
    float ym_kminus1;
    float ym_kminus2;
    float ym_kminus3;

    // recurrence equation variables for v ==> V(z)/U_{bounded}(z) = W_{m}(z)
    float v_kminus1;
